# Parameters
depth_multiple: 0.66  # model depth multiple
width_multiple: 1.  # layer channel multiple
depth_layer: [C3]
width_layer: [Conv, C3, SPPF, Detect]
anchors:
#  - [8,15, 18,30, 25,15]  # P3/8
#  - [32,61, 62,45, 59,119]  # P4/16
#  - [116,90, 156,198, 373,326]  # P5/32
  - [5,2, 6,9, 12,6]
  - [28,34, 57,33, 49,60]
  - [99,52, 82,103, 182,113]

# [from,  module, args], args=[ch_in , ch_out, etc]
backbone:
  [[-1, Conv, [32, 6, 2, 2]],  # 0-P1/2
   [-1, Conv, [32, 64, 3, 2]],  # 1-P2/4
   [-1, C3, [64, 64, 3]],
   [-1, Conv, [64, 128, 3, 2]],  # 3-P3/8
   [-1, C3, [128, 128, 6]],
   [-1, Conv, [128, 256, 3, 2]],  # 5-P4/16
   [-1, C3, [256, 256, 9]],
   [-1, Conv, [256, 512, 3, 2]], # 7-P5/32
   [-1, C3, [512, 512, 3]],
   [-1, SPPF, [512, 512, 5]],  # 9
  ]

neck:
  [[-1, Conv, [512, 512, 1, 1]],
   [-1, C3, [512, 256, 3, False]],  # 11 (P5/32-big)

   [-1, Conv, [256, 256, 1, 1]],
   [[-1, 4], Upsample_Concat,  [1, 'nearest']],  # cat backbone P4/8-medium
   [-1, C3, [256, 128, 3,  False]], #14

   [-1, Conv, [128, 128, 1, 1]],
   [[-1, 0], Upsample_Concat,  [1, 'nearest']],  # cat head P5
   [-1, C3, [64, 64, 6, False]],  # 17 (P3/2-small)
  ]

head:
  [[[17, 14, 11], Detect, [[64, 128, 256], nc, anchors]], # Detect(P3, P4, P5)
  ]

